// App.js

import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import HomePage from './components/HomePage';
import SecondaryPage from './components/SecondaryPage';
import ThirdPage from './components/ThirdPage';
import FourthPage from './components/FourthPage';
import FifthPage from './components/FifthPage';
import SixthPage from './';
import SeventhPage from './SeventhPage';
import SceneCard from './SceneCard'; // Import SceneCard component
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import './styles.css'; // Import custom styles

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/secondary">Secondary Page</Link>
            </li>
            <li>
              <Link to="/third">Third Page</Link>
            </li>
            <li>
              <Link to="/fourth">Fourth Page</Link>
            </li>
            <li>
              <Link to="/fifth">Fifth Page</Link>
            </li>
            <li>
              <Link to="/sixth">Sixth Page</Link>
            </li>
            <li>
              <Link to="/seventh">Seventh Page</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/secondary" element={<SecondaryPage />} />
          <Route path="/third" element={<ThirdPage />} />
          <Route path="/fourth" element={<FourthPage />} />
          <Route path="/fifth" element={<FifthPage />} />
          <Route path="/sixth" element={<SixthPage />} />
          <Route path="/seventh" element={<SeventhPage />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
